import React from 'react';
import { AppBar, Toolbar } from '@mui/material';
import MovieIcon from '@mui/icons-material/Movie';

const Header = () => {
  return (
    <div>
      return <AppBar>
            <Toolbar>
                <Box width={'20%'}>
                    <MovieIcon/>
                </Box>
            </Toolbar>
        </AppBar>;
    </div>
  );
}

export default Header;
